import React from "react";
import logo from "./logo.svg";
import "./App.css";

function GetJson() {
  return [
    {
      name: "test",
    },
    {
      name: "ed",
    },
  ];
}

function App() {
  let data = GetJson();
  {
    data.map((item) => {
      console.log(item.name);
    });
  }
  return (
    <div>
      <h1>Hi this is test</h1>
      <p>{data.name}</p>
    </div>

